import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import './App.css';

import squirrelImg from './images/Squirrel.png';
import penguinImg from './images/Penguin.png';
import owlImg from './images/Owl.png';
import foxImg from './images/Fox.png';
import raccoonImg from './images/Raccoon.png';
import cheetahImg from './images/Cheetah.png';
import goldenRetrieverImg from './images/GoldenRetriever.png';
import capybaraImg from './images/Capybara.png';


const animalData = {
  squirrel: {
    name: 'Squirrel',
    subtitle: 'The Over-Prepared Budgeter',
    description:
      "If financial responsibility were a sport, you'd be the MVP. Squirrels stash away acorns obsessively—just like you meticulously budget and save for the future.",
    strengths: "Hyper-organized with finances—probably has a color-coded spreadsheet for tracking expenses.",
    weaknesses: "Overthinks every purchase—even small, guilt-free splurges.",
    detailImage: squirrelImg,
    iconImage: squirrelImg,
  },
  penguin: {
    name: 'Penguin',
    subtitle: 'Debt Fighter',
    description:
      "Penguins waddle through life with the weight of their colony on their backs—just like you and your student loans. First priority? Paying off debt.",
    strengths:
      "Responsible, disciplined, probably has an airtight repayment plan and knows their credit score by heart.",
    weaknesses:
      "So focused on paying off debt that they forget life exists outside of financial survival mode.",
    detailImage: penguinImg,
    iconImage: penguinImg,
  },
  owl: {
    name: 'Owl',
    subtitle: 'The Investment Guru',
    description:
      "Wise and strategic, the owl is always thinking long-term. You’ve been tracking the stock market since before it was cool.",
    strengths: "Highly knowledgeable about investing and financial growth.",
    weaknesses: "Can be too cautious, overanalyzing opportunities and delaying action.",
    detailImage: owlImg,
    iconImage: owlImg,
  },
  fox: {
    name: 'Fox',
    subtitle: 'The Balanced Planner',
    description:
      "Clever and resourceful, the fox knows how to get the best deals while staying financially responsible.",
    strengths: "Smart with money—finds ways to save without extreme sacrifices.",
    weaknesses: "Might overthink financial decisions, leading to indecisiveness.",
    detailImage: foxImg,
    iconImage: foxImg,
  },
  raccoon: {
    name: 'Raccoon',
    subtitle: 'The Resourceful Hustler',
    description:
      "Raccoons thrive on resourcefulness, making the most out of anything they find.",
    strengths: "Excellent at finding new income streams and making money.",
    weaknesses: "Lacks financial stability—money comes and goes quickly.",
    detailImage: raccoonImg,
    iconImage: raccoonImg,
  },
  cheetah: {
    name: 'Cheetah',
    subtitle: 'The Impulsive Spender',
    description:
      "Just like a cheetah, your money moves fast—and usually straight out of your account.",
    strengths: "Enjoys life without financial anxiety.",
    weaknesses: "Poor savings habits—future-you is always left picking up the pieces.",
    detailImage: cheetahImg,
    iconImage: cheetahImg,
  },
  goldenRetriever: {
    name: 'Golden Retriever',
    subtitle: 'The Generous Spender',
    description:
      "You have a heart of gold—always treating friends, covering bills, and surprising people with gifts.",
    strengths: "Generous and thoughtful—always willing to help.",
    weaknesses: "Struggles to say no, even when money is tight.",
    detailImage: goldenRetrieverImg,
    iconImage: goldenRetrieverImg,
  },
  capybara: {
    name: 'Capybara',
    subtitle: 'The Chill Saver',
    description:
      "Unbothered and stress-free, the capybara is all about balance. You save just enough, spend just enough.",
    strengths: "Stays calm about money—no panic, no stress.",
    weaknesses: "Too passive—may miss opportunities to grow wealth.",
    detailImage: capybaraImg,
    iconImage: capybaraImg,
  },
};

// 定义图标在页面中的绝对定位（单位 px），顺序与 animalData 的 key 顺序对应
const iconPositions = [
  { left: 912, top: 295 },
  { left: 784, top: 423 },
  { left: 784, top: 679 },
  { left: 784, top: 551 },
  { left: 912, top: 423 },
  { left: 912, top: 551 },
  { left: 784, top: 295 },
  { left: 912, top: 679 },
];

const animalKeys = Object.keys(animalData);

const IntroductionPage = () => {
  // 初始选中 penguin
  const [selectedAnimal, setSelectedAnimal] = useState('penguin');
  const animal = animalData[selectedAnimal];

  return (
    <div
      style={{
        width: '1280px',
        height: '1093px',
        position: 'relative',
        background: '#0057FF',
      }}
    >
      {/* 顶部导航 */}
      <div
        style={{
          width: '156px',
          height: '68px',
          left: '761px',
          top: '35px',
          position: 'absolute',
          textAlign: 'center',
          color: 'white',
          fontSize: '32px',
          fontFamily: 'RL Aqva',
          fontWeight: 900,
          wordWrap: 'break-word',
        }}
      >
        <Link to="/quiz" style={{ color: 'white', textDecoration: 'none' }}>
          Quiz!
        </Link>
      </div>
      <div
        style={{
          width: '421px',
          height: '68px',
          left: '869px',
          top: '35px',
          position: 'absolute',
          textAlign: 'center',
          color: 'white',
          fontSize: '32px',
          fontFamily: 'RL Aqva',
          fontWeight: 900,
          wordWrap: 'break-word',
        }}
      >
        <Link to="/personality" style={{ color: 'white', textDecoration: 'none' }}>
          Personality Types
        </Link>
      </div>

      {/* 右侧图标组，点击图标切换对应的动物详情 */}
      {animalKeys.map((key, index) => {
        const pos = iconPositions[index];
        const data = animalData[key];
        return (
          <div
            key={key}
            onClick={() => setSelectedAnimal(key)}
            style={{
              width: '108px',
              height: '108px',
              position: 'absolute',
              left: `${pos.left}px`,
              top: `${pos.top}px`,
              cursor: 'pointer',
            }}
          >
            <div
              style={{
                width: '108px',
                height: '108px',
                position: 'absolute',
                background: 'white',
                borderRadius: '30px',
                border: '8px solid black',
              }}
            ></div>
            <img
              style={{
                width: '57px',
                height: '57px',
                position: 'absolute',
                left: '26px',
                top: '25px',
              }}
              src={data.iconImage}
              alt={data.name}
            />
          </div>
        );
      })}

      {/* 详情框 */}
      <div
        style={{
          width: '489px',
          height: '660px',
          left: '260px',
          top: '127px',
          position: 'absolute',
          background: '#CFF1FF',
          borderRadius: '30px',
          border: '10px solid black',
        }}
      ></div>

      {/* 详情框内文字与大图（绝对定位） */}
      <div
        style={{
          width: '300px',
          height: '50px',
          left: '289px',
          top: '149px',
          position: 'absolute',
          color: '#252525',
          fontSize: '24px',
          fontFamily: 'RL Aqva',
          fontWeight: 900,
          wordWrap: 'break-word',
        }}
      >
        {animal.name}
      </div>
      <div
        style={{
          width: '222px',
          height: '50px',
          left: '505px',
          top: '149px',
          position: 'absolute',
          textAlign: 'right',
          color: '#252525',
          fontSize: '24px',
          fontFamily: 'RL Aqva',
          fontWeight: 900,
          wordWrap: 'break-word',
        }}
      >
        {animal.subtitle}
      </div>
      <div
        style={{
          width: '432px',
          height: '216px',
          left: '289px',
          top: '222px',
          position: 'absolute',
          background:
            'linear-gradient(0deg, rgba(0,87,255,0.20) 0%, rgba(0,87,255,0.20) 100%)',
          borderRadius: '30px',
          border: '10px solid black',
        }}
      ></div>
      <img
        style={{
          width: '177px',
          height: '177px',
          left: '416px',
          top: '241px',
          position: 'absolute',
        }}
        src={animal.detailImage}
        alt={animal.name}
      />
      <div
        style={{
          width: '120px',
          height: '33px',
          left: '289px',
          top: '448px',
          position: 'absolute',
          color: '#252525',
          fontSize: '20px',
          fontFamily: 'RL Aqva',
          fontWeight: 900,
          wordWrap: 'break-word',
        }}
      >
        Who am I?
      </div>
      <div
        style={{
          width: '413px',
          height: '59px',
          left: '289px',
          top: '482px',
          position: 'absolute',
          color: '#252525',
          fontSize: '16px',
          fontFamily: 'Red Rose',
          fontWeight: 700,
          wordWrap: 'break-word',
        }}
      >
        {animal.description}
      </div>
      <div
        style={{
          width: '120px',
          height: '33px',
          left: '289px',
          top: '578px',
          position: 'absolute',
          color: '#252525',
          fontSize: '20px',
          fontFamily: 'RL Aqva',
          fontWeight: 900,
          wordWrap: 'break-word',
        }}
      >
        Strength
      </div>
      <div
        style={{
          width: '432px',
          height: '40px',
          left: '289px',
          top: '612px',
          position: 'absolute',
          color: '#252525',
          fontSize: '16px',
          fontFamily: 'Red Rose',
          fontWeight: 700,
          wordWrap: 'break-word',
        }}
      >
        {animal.strengths}
      </div>
      <div
        style={{
          width: '120px',
          height: '33px',
          left: '289px',
          top: '671px',
          position: 'absolute',
          color: '#252525',
          fontSize: '20px',
          fontFamily: 'RL Aqva',
          fontWeight: 900,
          wordWrap: 'break-word',
        }}
      >
        Weakness
      </div>
      <div
        style={{
          width: '432px',
          height: '40px',
          left: '289px',
          top: '701px',
          position: 'absolute',
          color: '#252525',
          fontSize: '16px',
          fontFamily: 'Red Rose',
          fontWeight: 700,
          wordWrap: 'break-word',
        }}
      >
        {animal.weaknesses}
      </div>
    </div>
  );
};

export default IntroductionPage;
